import React, { useState } from 'react';
import '../styles/DoctorProfilePage.css';

const DoctorProfilePage = () => {
  const [formData, setFormData] = useState({
    name: '',
    specialty: '',
    qualifications: '',
    hospital: '',
    location: '',
    experience: '',
    languages: '',
    fee: '',
    timing: '',
    isAvailable: false,
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData({
      ...formData,
      [name]: type === 'checkbox' ? checked : value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:5000/api/doctors', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      if (!response.ok) {
        throw new Error('Failed to add doctor profile');
      }

      const result = await response.json();
      alert(result.message);
      // Optionally, reset the form or redirect
      setFormData({
        name: '',
        specialty: '',
        qualifications: '',
        hospital: '',
        location: '',
        experience: '',
        languages: '',
        fee: '',
        timing: '',
        isAvailable: false,
      });
    } catch (error) {
      console.error('Error adding doctor profile:', error);
      alert(error.message);
    }
  };

  return (
    <div className="doctor-profile-container">
      <h1>Add Your Profile</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Name:</label>
          <input type="text" name="name" value={formData.name} onChange={handleChange} required />
        </div>
        <div>
          <label>Specialty:</label>
          <input type="text" name="specialty" value={formData.specialty} onChange={handleChange} required />
        </div>
        <div>
          <label>Qualifications:</label>
          <input type="text" name="qualifications" value={formData.qualifications} onChange={handleChange} required />
        </div>
        <div>
          <label>Hospital:</label>
          <input type="text" name="hospital" value={formData.hospital} onChange={handleChange} required />
        </div>
        <div>
          <label>Location:</label>
          <input type="text" name="location" value={formData.location} onChange={handleChange} required />
        </div>
        <div>
          <label>Experience (years):</label>
          <input type="number" name="experience" value={formData.experience} onChange={handleChange} required />
        </div>
        <div>
          <label>Consultation Fee (Rs):</label>
          <input type="number" name="fee" value={formData.fee} onChange={handleChange} required />
        </div>
        <div>
          <label>Timing:</label>
          <input type="text" name="timing" value={formData.timing} onChange={handleChange} required />
        </div>
        <div>
          <label>
            <input type="checkbox" name="isAvailable" checked={formData.isAvailable} onChange={handleChange} />
            Available for appointments
          </label>
        </div>
        <button type="submit">Submit Profile</button>
      </form>
    </div>
  );
};

export default DoctorProfilePage;
